import React, { useState, useContext, useEffect } from 'react';

const ProgressCircle = () => {
    return (
        <svg className="progress-ring" width="120" height="120">
            <circle
                className="progress-ring__circle"
                stroke="white"
                strokeWidth="4"
                fill="transparent"
                r="52"
                cx="40"
                cy="40"
            />
        </svg>
    );
}

export default ProgressCircle;
